import SearchBar from '../components/SearchBar.jsx';
import { Link, NavLink } from "react-router-dom";

const Nav = (props) => {
    return(
        <div>
            <SearchBar onSearch={props.onSearch} /> 

            <NavLink to="/about">
                <button>About</button>
            </NavLink>

            <NavLink to="/home">
                <button>Home</button>
            </NavLink>
        </div>
    );
}

export default Nav;
